import React from 'react';
import { Link } from 'react-router-dom';
import PrivacyPolicy from '../pages/PrivacyPolicy';

const Footer = () => {
  return (
    <footer className="footer bg-blue-800 text-white py-6">
      <div className="container mx-auto px-4">
        <div className="flex flex-col md:flex-row justify-between items-center">
          <p className="text-center md:text-left">
            &copy; 2024 <Link to="/team" className="text-yellow-300 hover:text-yellow-400">CODE-A-COLA</Link> . All rights reserved.
          </p>
          <nav className="text-sm flex flex-col md:flex-row mt-4 md:mt-0">
            <a href="/privacy-policy" className="hover:underline mx-2">Privacy Policy</a>
            <a href="/terms" className="hover:underline mx-2">Terms & Conditions</a>
            <a href="/accessibility" className="hover:underline mx-2">Accessibility</a>
          </nav>
        </div>
      </div>
    </footer>
  );
};

export default Footer;
